import React, {useState} from "react";
import styled from "styled-components";
import Profile from "./Profile";
import Snooze from "./Snooze";

export default function Dashboard({ setCount, count }) {

  const [pause, setPause] = useState(false)

  return (
    <div>
      <Section>
        <div className="grid">
          <div className="row__one">
            <Snooze onClick={setPause(true)} />
          </div>
          <div className="row__two">
            <Profile setCount={setCount} count={count}  pause={pause} />
          </div>
        </div>
      </Section>
    </div>
  );
}

const Section = styled.section`
  margin-left: 1vw;
  padding: 1rem;
  height: auto;
  width: 100%;
  margin-bottom: 70px;

  .grid {
    display: flex;
    flex-direction: column;
    height: auto;
    padding-left: 0%;
    padding-right: 0%;
    gap: 1rem;
    margin-top: 0rem;

    .row__one {
      display: grid;
      grid-template-columns: repeat(1, 1fr);
      height: auto;
      gap: 1rem;
    }

    .row__two {
      display: grid;
      grid-template-columns: repeat(1, 1fr);
      height: auto;
      width: 100%;
      margin: auto;
      margin-top: 1rem;
      gap: 1rem;
    }
  }
`;
